import React from 'react';

const Box = (props) => {
    console.log("props : " , props)
    return (
            <div style={{width:200+'px',height:200+'px',backgroundColor:"red"}} onClick={()=>props.getColorFun(props.color)}>
            </div>  
    );
}

export default Box
